  const req = axiosPrivate.post("/checkusers", {
    headers: { authorization: "Bearer " + data },
  });
  try {
    console.log("3. Get Contact Berhasil :", req);
    // dispatch({
    //   type: ACCESS_TOKEN_USER,
    //   payload: req.data,
